}

const Book = () => {
  return (
    <article>
      <Image />
      <Title />
      <Author />
    </article>
  );
};

const Image = () => (
  <img src="https://m.media-amazon.com/images/I/61JSKZ6vHQS._AC_UY218_.jpg" />
);

const Title = () => <h1>Title</h1>;

const Author = () => <h1>Author</h1>;

